import { useState } from "react";
import data from "./Data2";
import "./Content.css";
import Item from "./Item";
const Content = () => {
  const properties = data.properties;
  return properties.map((value) => {
    if (value.index % 4 == 0) {
      return (
        <div className="wrapper">
          <Item
            one={value.index}
            two={value.index + 1}
            three={value.index + 2}
            four={value.index + 3}
          />
        </div>
      );
    }
  });
};
export default Content;
